import React from "react";
import Header from "./components/header/Header";
import Main from "./components/main/Main";

function App() {
  const houses = [
    { src: "https://static.wikia.nocookie.net/harrypotter/images/0/01/Gryffindor.png/revision/latest?cb=20150807113230&path-prefix=ruhttps://static.wikia.nocookie.net/harrypotter/images/0/01/Gryffindor.png/revision/latest/thumbnail/width/360/height/360?cb=20150807113230&path-prefix=ru", alt: "Gryffindor" },
    { src: "https://i.pinimg.com/564x/4d/ab/0a/4dab0a87210b79bfbb9adbb5432847be.jpg", alt: "Ravenclaw" },
    { src: "https://i.pinimg.com/564x/62/45/f9/6245f9e0fe98a75e37f1e4d7103066ed.jpg", alt: "Slytherin" },
    { src: "https://i.pinimg.com/564x/ad/76/e8/ad76e8070c8a922a4a2920c28b6bb07b.jpg", alt: "Hufflepuff" }
  ];

  return (
    <>
      <Header />
      <Main houses={houses} />
    </> 
  );
}

export default App;
